const cardEdit = resolve => {
  import('./edit').then(module => {
    resolve(module)
  })
}
const cardDetail = resolve => {
  import('./detail').then(module => {
    resolve(module)
  })
}
const cardPreview = resolve => {
  import('./preview').then(module => {
    resolve(module)
  })
}
const companyInfo = resolve => {
  import('./company').then(module => {
    resolve(module)
  })
}
const cardCollection = resolve => {
  import('./collection').then(module => {
    resolve(module)
  })
}

export default [
  {
    name: 'cardEdit',
    path: '/card/edit',
    component: cardEdit,
    meta: {
      nav: false,
      auth: true,
      title: '编辑名片',
      keepAlive: true
    }
  },
  {
    name: 'cardDetail',
    path: '/card/detail/:id',
    component: cardDetail,
    meta: {
      nav: false,
      auth: false,
      title: '名片详情',
      keepAlive: true
    }
  },
  {
    name: 'cardPreview',
    path: '/card/preview',
    component: cardPreview,
    meta: {
      nav: false,
      auth: false
    }
  },
  {
    name: 'cardCollection',
    path: '/card/collection',
    component: cardCollection,
    meta: {
      nav: false,
      auth: false,
      title: '名片夹',
      keepAlive: true
    }
  },
  {
    name: 'companyInfo',
    path: '/companyInfo/:id',
    component: companyInfo,
    meta: {
      nav: false,
      auth: false
    }
  }
]
